import React, { useEffect } from "react";
import 'mapbox-gl/dist/mapbox-gl.css';
import './mapa.css';
import mapboxgl from 'mapbox-gl';

function Map(props) {
    useEffect( () => {
        cargarMapa();
    }, []);
    
    function cargarMapa(){
        mapboxgl.accessToken = 'pk.eyJ1IjoianBvcnRlaXJvIiwiYSI6ImNrbm54MzV4eTEyaXoyc294Y3F3bXV0d3AifQ.MLAbktKm3nrID_oLqs1B8g';
        const map = new mapboxgl.Map({
            container: 'map', // container ID
            style: 'mapbox://styles/mapbox/streets-v11', // style URL
            center: [-74.5, 40], // starting position [lng, lat]
            zoom: 9 // starting zoom
        });
    
        new mapboxgl.Marker({
            color: "black",
            draggable: true
            }).setLngLat([-74.5, 40])
            .setPopup(new mapboxgl.Popup().setHTML("<h1>Sucursal1</h1>"))
            .addTo(map);
    }
    
      
    return(
        <main id="main">
            <div id="contenedor">
                <div id="map"></div>
                <div class="horario">
                    <p>Nuestro horario de atención es:</p>
                    <ul>
                        <li>De Lunes a Viernes de 9:00 a 13 y 14 a 19 hrs</li>
                        <li>Los Sábados de  9 a 14hrs</li>
                    </ul>
                </div>
                <div class="ubicacion">
                    <p>Dirección:</p>
                    <ul>
                        <li></li>
                    </ul>
                </div>
            </div>
        </main>
    );
}
  
export default Map;
